import {useEffect} from 'react'

function FetchEMA10Calculation({stockCode, onEMA10CalculationFetch}) {
    useEffect(() => {
        if(stockCode) {
            fetch(`http://127.0.0.1:8000/api/calculation_ema10/${stockCode}/`)
                .then(response => response.json())
                .then(data => {if(onEMA10CalculationFetch) onEMA10CalculationFetch(data)
                console.log(data)})
                .catch(error => console.error('Error Stock Data:', error));
        }
    }, [stockCode]);
    return null;
}
export default FetchEMA10Calculation;
